Trump won’t meet with Democratic leaders & Speaker Johnson sent the House home without a deal on government funding.

Republicans aren’t serious about governing or avoiding a shutdown.

@HouseDemocrats support a bipartisan deal that keeps the government open & protects YOUR health care costs.

Happy Sneaker Day on the Hill! 👟

@Rep_Stansbury, @RepBeccaB, and I are laced up and ready to go, but can you guess whose kicks are whose?

Drop your guess in the comments ⬇️ #CongressGotKicks https://t.co/b83UVzNoXi

Happy Birthday, Oregon! 🎂

In honor of our great state's 166th birthday, a few of us in the Oregon delegation put together a video of fun facts we love about our home state. Watch it below 👇

@RepBonamici @RepDexterOR @RepValHoyle @RepBynum https://t.co/8XACVdrt44

Canada buys more Oregon wine than any other country—about 50%.

Trump's trade war will directly harm wineries in my district, in addition to so many other Oregon industries.

@POTUS needs to change course and stop this reckless tax on our growers and small businesses.

The Fourteenth Amendment states that “all persons born or naturalized in the United States are citizens of the United States.”

@POTUS' attempt to change that through executive order is both unconstitutional and un-American.

Watch my full speech on the House floor 👇 https://t.co/efVKlfhfxC
